function Heading(props){
const style={
color:" #3B3B3B",
fontSize:`${props.size}`,
fontFamily:"'PT Serif', serif",
textAlign:"center",
marginBottem:`${props.marginbottem}`,
marginTop:`${props.margintop}`


}
return(
    <h1 style={style}>{props.text}</h1>
)



}
export default Heading;
